export function locparser(count, props) {
    if (count == 1) {
        let location1;
        location1 = (props.location == '') ? '' : props.location.split(", ", 1);
        return location1;
    } else if (count == 2) {
        let location2;
        location2 = ((props.location == '') ? '' :
            (
              props.location.substring(((`${location1}, `).length),)
            ))
        return location2;
    }
}
